  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This brief presentation outlines the
  educational objectives for the Introduction to Medicare workshop. Objectives of
  the workshop which are found in the various video segments include<br />n-understanding
  the basic structure and content of the Medicare program<br />n-learning which Medicare
  data files are available for research purposes<br />n-knowing the source of the
  Medicare administrative data sets<br />n-reviewing the Master Beneficiary Summary
  File (a.k.a. Denominator), MedPAR file, and the Carrier file for use by researchers</p>n\",\n\t\"license_title\":
